import React, { Component } from "react";
import NavBar from "./components/navbar";

class App extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <main className="container"></main>
      </React.Fragment>
    );
  }
}

export default App;
